import React from "react";
import CouponCard from "../../components/Global/Coupon/couponCard";
import ProductCard from "../../components/Global/Card/productCard";
import Loading from "../../components/Global/Loading/Loading";
import useFetch from "../../hooks/useFetch";
import { Link } from "react-router-dom";

const Admin = () => {
  const { isLoading, error, data: coupon } = useFetch("/coupons");

  if (error) {
    return <p>{error}</p>;
  }

  if (isLoading) {
    return <Loading />;
  }

  return (
    <div>
      <h1>Admin page</h1>
      <p>Welkom op de administrtor page</p>
      <div className="couponcodes">
        <h2>Coupon codes</h2>
        <Link to={"/admin/addCoupon"}>
          <i className="fa-solid fa-plus"></i>
        </Link>
        {coupon.map((coupon) => (
          <div className="col" key={coupon._id}>
            <CouponCard coupon={coupon} />
          </div>
        ))}
      </div>
      <div className="products">
        <h2>Producten</h2>
        {/* <ProductCard key={_id} /> */}
      </div>
    </div>
  );
};

export default Admin;
